----- Movies -----

alter table movies
add column date_1 date;

update movies
set date_1 = cast(date_published as date);

create table movies_1 as select * From movies;

select * from movies_1;

drop table movies;

create table movies 
(id varchar(250), title varchar(500),
year int, date_published date,
duration int, country varchar(250),
worlwide_gross_income varchar(250),
languages varchar(250), production_company varchar(250)
);

select id,title,year,date_1,duration,country,worlwide_gross_income,languages,production_company from movies_1);

drop table movies_1;

